import { useRef } from "react";
import axios from "axios";
import { useHistory } from "react-router-dom";
import {useState} from 'react';

function MyProfile(props) {

    const [ime, setIme] = useState("Sima");


    
    let userr;

    axios({
        method: "get",
        url: "users/1",
      }).then((response) => {
        console.log("RESPONSE", response);
        console.log("DATA", response.data);
        userr = response.data;
        console.log("USER", userr);
      });




  return (
    <div>
      <form>
        <img
          className="mb-4"
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSN6PSb90rGnT4WTxYC7HBxNWs2Ig-mSP2b0g&usqp=CAU"
          alt=""
          width="72"
          height="57"
        />
        <h1 className="h3 mb-3 fw-normal">Change user data</h1>
        <div className="form-floating">
          <input
            type="text"
            className="form-control"
            placeholder="name"
            // ref={nameInputRef}
            // onChange={props.changeUser}
            defaultValue={ime}
            onChange={event=>setIme(event.target.ime)}
          />
          <label htmlFor="floatingInput">Name</label>
        </div>
        
        <label>{props.user.name}</label>
        <label>{ime}</label>
      </form>
    </div>
  );
}

export default MyProfile;
